import React from "react";
import Card from "@mui/material/Card";
import SoftBox from "components/SoftBox";
import SoftTypography from "components/SoftTypography";
import SoftInput from "components/SoftInput";
// import Softcaption from "components/Softcaption";
import { FormControl, Icon } from "@mui/material";
import AccountCircle from "@mui/icons-material/AccountCircle";
const Infleta = () => {
  return (
    <Card>
      <SoftBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <SoftBox>
          <SoftTypography variant="h6" gutterBottom>
            ¿Cuotas o Contado?
          </SoftTypography>
          <SoftBox display="flex" gap={1} alignItems="center" lineHeight={0}>
            <Icon
              sx={{
                fontWeight: "bold",
                color: ({ palette: { info } }) => info.main,
                // mt: -0.5,
              }}
              fontSize="large"
            >
              price_change
            </Icon>
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              <strong> Mejora tu estrategia de pagos: </strong>calcula si te conviene cuotas o pago
              único.
            </SoftTypography>
          </SoftBox>
        </SoftBox>
        <SoftBox color="text" px={2}>
          <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small">
            restart_alt
          </Icon>
        </SoftBox>
      </SoftBox>
      <SoftBox
        component="form"
        role="form"
        display="flex"
        flexDirection="column"
        justifyContent="space-around"
        gap={2}
        pl={2}
        pr={2}
        pb={2}
      >
        <SoftBox>
          <SoftBox pl={1}>
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              Ingresá el precio de contado
            </SoftTypography>
          </SoftBox>
          <SoftInput
            placeholder="10000"
            icon={{
              component: "attach_money",
              direction: "right",
            }}
          />
        </SoftBox>
        <SoftBox>
          <SoftBox pl={1}>
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              Ingresá el precio total en cuotas
            </SoftTypography>
          </SoftBox>
          <SoftInput
            placeholder="16000"
            icon={{
              component: "credit_card",
              direction: "right",
            }}
          />
        </SoftBox>
        <SoftBox>
          <SoftTypography variant="caption" fontWeight="regular" color="text">
            Inflación mensual estimada
          </SoftTypography>

          <SoftInput
            placeholder="8.4"
            icon={{
              component: "request_quote",
              direction: "right",
            }}
          />
        </SoftBox>
        <SoftBox>
          <SoftBox pl={1}>
            <SoftTypography variant="caption" fontWeight="regular" color="text">
              Cantidad de cuotas
            </SoftTypography>
          </SoftBox>
          {/* <Cantidaddecuotas/> */}
          <FormControl fullWidth>
            <InputLabel id="demo-simple-select-label">Age</InputLabel>
            <Select
              labelId="demo-simple-select-label"
              id="demo-simple-select"
              value={age}
              label="Age"
              onChange={handleChange}
            >
              <MenuItem value={10}>Ten</MenuItem>
              <MenuItem value={20}>Twenty</MenuItem>
              <MenuItem value={30}>Thirty</MenuItem>
            </Select>
          </FormControl>
        </SoftBox>
      </SoftBox>
    </Card>
  );
};

export default Infleta;
